import { Data, DataEntry } from "./types";

function parse(...pool: [number, string, string?][]) {
	let total = 0;
	const entries = pool.map(([ weight, value, encoded ]) => {
		const min = total;
		const max = total += weight;
		return { min, max, value, encoded };
	});
	return { total, entries };
}

